import React from "react";
import { Canvas } from "react-three-fiber";
const FirstComponent = () => {
  function Box() {
    return (
      <mesh>
        <boxBufferGeometry
          attach="geometry"
          args={[1, 1, 1]}
        ></boxBufferGeometry>
        <meshBasicMaterial attach="material" color="red"></meshBasicMaterial>
      </mesh>
    );
  }

  return (
    <div>
      <Canvas>
        <Box />
      </Canvas>
    </div>
  );
};

export default FirstComponent;
